//app.js
App({
  onLaunch: function () {
    // 展示本地存储能力
    var logs = wx.getStorageSync('logs') || []
    logs.unshift(Date.now())
    wx.setStorageSync('logs', logs)

    // 登录
    wx.login({
      success: res => {
        // 发送 res.code 到后台换取 openId, sessionKey, unionId
      }
    })
    // 获取用户信息
    wx.getSetting({
      success: res => {
        if (res.authSetting['scope.userInfo']) {
          // 已经授权，可以直接调用 getUserInfo 获取头像昵称，不会弹框
          wx.getUserInfo({
            success: res => {
              // 可以将 res 发送给后台解码出 unionId
              this.globalData.userInfo = res.userInfo

              // 由于 getUserInfo 是网络请求，可能会在 Page.onLoad 之后才返回
              // 所以此处加入 callback 以防止这种情况
              if (this.userInfoReadyCallback) {
                this.userInfoReadyCallback(res)
              }
            }
          })
        }
      }
    })
  },
  globalData: {
    userInfo: null,
    requestInfo: {
      baseUrl: 'http://192.168.189.89:3000',
      detectFace: '/Bd/index/detectFace',
      getToken: '/Bd/index/token',
      getBase64: '/Bd/index/upload',
      getResult: '/Bd/index/result'
    },
    imageData: '',
    detectData: {"error_code":0,"error_msg":"SUCCESS","log_id":4030258880,"timestamp":1528254091,"cached":0,"result":{"face_num":1,"face_list":[{"face_token":"a64ae584783acf5cdfe59f161fc79fd5","location":{"left":137.4080505,"top":127.6473007,"width":164,"height":154,"rotation":7},"face_probability":1,"angle":{"yaw":13.90383244,"pitch":3.889528036,"roll":9.769182205},"age":22,"beauty":96.38738251,"expression":{"type":"none","probability":0.9995077848},"face_shape":{"type":"heart","probability":0.4266615212},"gender":{"type":"female","probability":0.9999762774},"glasses":{"type":"none","probability":0.9999988079},"race":{"type":"yellow","probability":0.9999482632},"quality":{"occlusion":{"left_eye":0.07898658514,"right_eye":0.6299045682,"nose":0,"mouth":0,"left_cheek":0.06164383516,"right_cheek":0.1696400642,"chin_contour":0},"blur":1.647215839e-7,"illumination":183,"completeness":1},"face_type":{"type":"human","probability":0.9929862618}}]}}
  }
})